body {
    font-family: Arial, sans-serif;
    background-color: #f4f4f4;
    margin: 0;
    padding: 0;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    height: 100vh;
}

.header {
    width: 100%;
    background-color: white;
    padding: 20px 0;
    text-align: center;
}

.header h1 {
    color: black;
    margin: 0;
    font-size: 24px;
}

.video-container {
    width: 80%;
    max-width: 1200px;
    min-width: 300px;
    background-color: #fff;
    box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
    border-radius: 10px;
    overflow: hidden;
    text-align: center;
}

.video-container h2 {
    padding: 15px;
    margin: 0;
    background-color: #ffbb00;
    font-size: 18px;
}

/* Wrapper to maintain 16:9 aspect ratio */
.video-wrapper {
    position: relative;
    width: 100%;
    padding-top: 56.25%; /* 16:9 aspect ratio */
}

.video-wrapper iframe {
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    border: none;
}
